import React, { useState } from 'react';
import '../commonStyles/colors.css';
import '../commonStyles/widgets.css';
import '../commonStyles/layout.css';
import DashboardLogo from './DashboardLogo';
import DashboardGrid from './DashboardGrid';
import ClientTable from '../tables/ClientTable';

const DashboardLayout = () => {
  const [showClientTable, setShowClientTable] = useState(false);

  // Временные тестовые данные для виджета
  const userData = {
    name: "John",
    surname: "Doe",
    logo: null // Будет использоваться логотип по умолчанию
  };
  
return (
    <div className="dashboard-container">
      <svg 
 xmlns="http://www.w3.org/2000/svg"
 xmlnsXlink="http://www.w3.org/1999/xlink"
 width="1366px" height="765px">
<image  opacity="0.371" x="0px" y="0px" width="1366px" height="765px"  href="data:img/png;base64," />
</svg>
      
<div className="dashboard-content">
  <div className="dashboardlogo-wrapper">
    <DashboardLogo />
  </div>
  {!showClientTable ? (
          <div className="grid-container">  {/* контейнер для грида */}
            <DashboardGrid onClientsClick={() => setShowClientTable(true)} />
          </div>
        ) : (
          <div className="table-container">  {/* контейнер для таблицы */}
            <ClientTable onClose={() => setShowClientTable(false)} />
          </div>
        )}
</div>
</div>
  );
};


export default DashboardLayout;